import React, { useState, useEffect } from 'react';
import Pagination from './Pagination';
import axios from 'axios';
import { useParams } from 'react-router-dom';

import './ViewTreatmentProfile.css'; // Import the CSS file for styling

function ViewTreatmentProfile() {
  const [selectedSymptom, setSelectedSymptom] = useState(null);
  const [selectedProgress, setSelectedProgress] = useState(null);

  const [currentPage, setCurrentPage] = useState(1);
  const itemsPerPage = 3; // Number of items to display per page

  const { id } = useParams(); // Get the ID from the URL

  const [treatmentProfile, setTreatmentProfile] = useState(null);

  useEffect(() => {
    const fetchTreatmentProfile = async () => {
      try {
        const response = await axios.get(`http://localhost:3000/api/treatment_profile/details?id=${id}`); // Replace with your API endpoint
        const profileData = response.data.treatmentProfile;
        setTreatmentProfile(profileData);
      } catch (error) {
        console.error('Error fetching treatment profile:', error);
      }
    };

    fetchTreatmentProfile();
  }, [id]);

  const handlePageChange = (page) => {
    setCurrentPage(page);
  };

  const handleSymptomClick = (symptom) => {
    setSelectedSymptom(symptom);
  };

  const handleProgressClick = (progress) => {
    setSelectedProgress(progress);
  };

  const handleClosePopUp = () => {
    setSelectedSymptom(null);
  };

  const handleCloseProgressPopUp = () => {
    setSelectedProgress(null);
  };

  const handleConfirm = () => {
    // Handle the confirmation logic here
    alert('Profile confirmed');
  };

  if (!treatmentProfile) {
    return <p>Loading...</p>;
  }

 

  return (
    <div className="profile-container">
      <h2>Treatment Profile</h2>
      <div className="profile-details">
        <p>
          <strong>Name:</strong> {treatmentProfile.description}
        </p>
        <p>
          <strong>ID:</strong> {treatmentProfile.id}
        </p>
        <p>
          <strong>Gender:</strong> {treatmentProfile.gender}
        </p>
        <p>
          <strong>Doctor Name:</strong> {treatmentProfile.doctorName}
        </p>
        <p>
          <strong>Treatment Date:</strong> {treatmentProfile.treatmentDate}
        </p>
        
        <div className="treatment-progress">
          <h3>Treatment Progress</h3>
          {treatmentProfile.treatmentProgress.map((progress, index) => (
            <div
              key={index}
              className="treatment-box"
              onClick={() => handleProgressClick(progress)}
            >
              <p>{progress.time}</p>
              <p>{progress.date}</p>
              <p>{progress.date}</p>
              <p>Result: {progress.result}</p>
              <p>Note: {progress.note}</p>
            </div>
          ))}
        </div>

        
      </div>
      <button className="confirm-button" onClick={handleConfirm}>
        Write Treatment In
      </button>

      {selectedSymptom && (
        <div className="overlay">
          <div className="pop-up">
            <h3>{selectedSymptom.name}</h3>
            <p>{selectedSymptom.description}</p>
            <button className="close-button" onClick={handleClosePopUp}>
              Close
            </button>
          </div>
        </div>
      )}
      {selectedProgress && (
        <div className="overlay">
          <div className="pop-up">
            <h2>Treatment Progress</h2>
            <p>
              <strong>Time:</strong> {selectedProgress.time}
            </p>
            <p>
              <strong>Date:</strong> {selectedProgress.date}
            </p>
            <p>
              <strong>Process:</strong> {selectedProgress.process}
            </p>
            <p>
              <strong>Result:</strong> {selectedProgress.result}
            </p>
            <p>
              <strong>Note:</strong> {selectedProgress.note}
            </p>
            <button className="close-button" onClick={handleCloseProgressPopUp}>
              Close
            </button>
          </div>
        </div>
      )}
    </div>
  );
}

export default ViewTreatmentProfile;
